layer_keys = list(n)
layer_keys.remove('in')
layer_keys.remove('ot')
layer_keys = sorted(layer_keys, key=lambda x : int(x[1:]))    # key is the single- or multi-digit number after the first character
layer_keys.append('ot')    # layer_keys now starts with the first hidden layer upto the last and then the output layer

# tf graph input
x = tf.placeholder(tf.float32, shape=(None, n['in']))
# nearly_one is the largest fraction that can be represented by n_bits_after_point, e.g. for 7 bits, 0b0.1111111 = 0.9921875
n_bits_after_point = 7
f                  = 2 ** n_bits_after_point
nearly_one         = 1.0 - 1.0 / f

def low_precision_tanh(theta): # low_precision_tanh() has n_bits_after_point. input range [+/-255.9921875] 
    return tf.round(tf.tanh(theta) * f) / f          # output range [+/-0.9921875]

def low_precision_multilayer_perceptron(inputs, weights, biases):
    layer['in'] = inputs
    prev_key    = 'in'
    for key in layer_keys:
        layer[key] = low_precision_tanh(tf.add(tf.matmul(layer[prev_key], tf.constant(weights[key], dtype = tf.float32)), tf.constant( biases[key], dtype = tf.float32)))
        prev_key   = key
    return layer['ot']

# define op for the tensorflow graph
low_precision_pred = low_precision_multilayer_perceptron(x, weights, biases)

def classification_metrics(features, labels):
    low_precision_preds         = low_precision_pred.eval({x: features})
    low_precision_correct_preds = tf.to_float(tf.equal(tf.argmax(low_precision_preds, 1), tf.argmax(labels, 1)))

    # convert 2-output {+/-0.9921875} to single ouput {0,1} format to aid in metrics' calculations
    labels_single_col_0_1 = tf.to_float((labels[:,0] + nearly_one) / (2 * nearly_one))
    # recreate prediction in single ouput {0, 1} format to aid in metrics' calculations
    preds_single_col_0_1  = tf.to_float(tf.equal(labels_single_col_0_1, low_precision_correct_preds))
    
    tn = tf.count_nonzero((labels_single_col_0_1 - 1) * (preds_single_col_0_1 - 1))
    fp = tf.count_nonzero((labels_single_col_0_1 - 1) *  preds_single_col_0_1     )
    fn = tf.count_nonzero( labels_single_col_0_1      * (preds_single_col_0_1 - 1))
    tp = tf.count_nonzero( labels_single_col_0_1      *  preds_single_col_0_1     )

    accuracy  =              (tp + tn) / (tp + tn + fp + fn)
    precision =                     tp / (tp + fp)
    recall    =                     tp / (tp + fn)
    f1        = 2 * precision * recall / (precision + recall)
        
    return 'tp {:1d} tn {:1d} fp {:1d} fn {:1d} ac {:8.6f} pr {:8.6f} rc {:8.6f} f1 {:8.6f}'.format(
        sess.run(tp), sess.run(tn), sess.run(fp), sess.run(fn), sess.run(accuracy), sess.run(precision), sess.run(recall), sess.run(f1))
# split dataframe into seperate feature and label arrays
features = data_ts_processed.loc[:, data_ts_processed.columns != 'class'].values
labels   = data_ts_processed.loc[:, data_ts_processed.columns == 'class'].values

# convert single-element outputs to 2-element outputs
labels_opposite = np.multiply(labels, -1)
labels          = np.concatenate((labels, labels_opposite), axis=1)

with tf.Session() as sess:
    sess.run(tf.global_variables_initializer())
    print('Classification metrics', classification_metrics(features, labels))